function dateDiff(t,e){let o={};e-=t,e=Math.floor(e/1e3);return o.sec=e%60,e=Math.floor((e-o.sec)/60),o.min=e%60,e=Math.floor((e-o.min)/60),o.hour=e%24,e=Math.floor((e-o.hour)/24),o.day=e,o}function Dec2Time(t){let e=String(t).split(".");t=e[0];let o=String(parseFloat("0."+e[1])).split(".")[1];return t+":"+(o=(0==+e[1].split("")[0]?(6*(0|+o)).toString().padStart(3,"0"):(6*(0|+o)).toString().padStart(2,"0")).slice(0,2))}function sortSelect(t){$("#"+t).append($(`#${t} option`).sort(function(t,e){return t.text>e.text?1:t.text<e.text?-1:0})),$("#"+t)[0].selectedIndex=0}